INSERT INTO `tbl_cms` (`fld_cmsid`, `fld_cmspage`, `fld_pagecontent`, `fld_createdAt`) VALUES (1,'about.php','<p>HalalJourney&reg; or HJ is a new visionary concept in Halal Travel with an ethos that families and muslims travellers can trust. Through world class technology, a state of the art multi-lingual booking platform and providing the tradtional travel services we all know and love.</p>\r\n<p>Our local teams based in our registerd offices in Riyhad, Saudi Arabia and Zurich, Switzerland and across Asia have extesive in-country knowlege. Our Halal travel specialists can offer you stays at exclusive luxury hotels, rejuvinating weekends, villas with a private pool and stunning destinations in South East Asia all rated by the needs of our islamic values and rated by our customers.</p>\r\n<p>Our resorts are packed full of fun-filled Muslim friendly activities, tailor-made for our Muslim travellers offering new experiences, award winning cuisine, respectful levels of privacy, prayer facilities, and non- alcoholic rooms. For futher information contact our local in-country treams who are based in Asia, GCC, Switzerland who will hand over to our inhouse host representataives to ensure you have the best possible experience whlist you are on holiday.</p>\r\n<p>HJ</p>','2016-09-14'),(2,'contact-us.php','<ul>\n<li class=\"contact-phone\"><b>Phone:</b> +41 435 66138</li>\n<li class=\"contact-email\"><b>Email us:</b> info@halaljourney.com</li>\n<li class=\"contact-address\"><b>Address:</b> Mettlenstrasse 31B, 8193 <br>Z&uuml;rich Switzerland</li>\n</ul>','2016-09-14');
